metadata.preview:
          } : {
            terminal: "default"
          })
        }
      }
    }
  }
};

const response = await fetch('/api/vozovoz', {
  method: 'POST',
  headers: {
    'Content-Type': 'application/json',
  },
  body: JSON.stringify(requestData),
});

if (!response.ok) {
  throw new Error(`Ошибка API: ${response.status}`);
}
